import Frederik from '../../assets/images/frederik.svg';
import Niels from '../../assets/images/niels.svg';
import Grid from '@material-ui/core/Grid';
import { Card, CardTitle, Icon } from 'react-materialize';
import './Startup.css';


const services = props => {
  return (
    <div className="">
        
        <Grid container  >
        <Grid item md={2} xs={1}>
      </Grid>
      <Grid container md={8} xs={10}>
      <Grid container md={12} justify="center"
  alignItems="center">
          <h2>OUR STARTUP PARTNERS</h2>
          
          </Grid>
          <Grid container md={12} spacing={2}>
          <Grid item md={2}><a href="https://hjaelptilpaaroerende.dk"><img src={a1}></img></a></Grid>
          <Grid item md={2}><a href="http://relion.dk"><img src={a2}></img></a></Grid>
          <Grid item md={2}><a href="http://backpackerlife.dk"><img src={a3}></img></a></Grid>
          <Grid item md={2}><a href="https://www.noatronic.com"><img src={a4}></img></a></Grid>
          <Grid item md={2}><a href="https://neurospace.io"><img src={a5}></img></a></Grid>
          <Grid item md={2}><a href="https://privatbar.dk"><img src={a6}></img></a></Grid>
          <Grid item md={2}><a href="http://parkshare.dk"><img src={a7}></img></a></Grid>
          <Grid item md={2}><a href="#"><img src={a8}></img></a></Grid>
          <Grid item md={2}><a href="http://manigrip.dk"><img src={a9}></img></a></Grid>
          <Grid item md={2}><a href="https://oldenkombucha.dk"><img src={a10}></img></a></Grid>
          <Grid item md={2}><a href="https://aarhusblendin.dk"><img src={a11}></img></a></Grid>
          <Grid item md={2}><a href="#"><img src={a12}></img></a></Grid>
          <Grid item md={2}><a href="#"><img src={a13}></img></a></Grid>
          <Grid item md={2}><a href="#"><img src={a14}></img></a></Grid>
          <Grid item md={2}><a href="#"><img src={a15}></img></a></Grid>
          <Grid item md={2}><a href="http://mindyourtalent.dk/"><img src={a16}></img></a></Grid>
          <Grid item md={2}><a href="https://elevaid.dk/"><img src={a17}></img></a></Grid>
          <Grid item md={2}><a href="https://thekitchen.io/"><img src={a18}></img></a></Grid>
          
          </Grid>
          
      </Grid>
      
      <Grid item md={2}>
      </Grid>
      </Grid>
</div>
  );
    
};

export default services;
